  false,\n\t\"url\": null,\n\t\"notes\": \"One magnetic tape containing the physical
  and chemical properties of San Francisco Bay waters was forwarded to NODC by Mr.
  Richard Smith of the U.S Geological Survey (USGS), Water Resources Division. The
  data were collected as part of the San Francisco Bay Estuarine Study aboard the
  POLARIS from April 10, 1969 to September 20, 1976. The parameters in this data set
  include: salinity, temperature oxygen, silicate, nitrate, nitrite and ph. Latitudes
  and longitudes are expressed in meters. The data is now available online in the
  current NODC data storage format.\",\n\t\"license_title\": null,\n\t\"extras\":
